import React from 'react'

export default function Sidebar () {
  return (
    <div className='w3-sidebar w3-bar-block' style={{ width: '20%' }}>
      <a href='#'>All</a>
      <a href='#'>To-Do Lists</a>
      <a href='#'>Cornell Notes</a>
      <a href='#'>Journal Entries</a>
      <a href='#'>About</a>
    </div>
  )
}
